function App() {
  const date = new Date();
  const hrs = date.getHours();
  const greeting = function () {
    if (hrs < 12) {
      return "Good Morning";
    } else if (hrs > 12 && hrs < 19) {
      return "Good Afternoon";
    } else {
      return "Good Night";
    }
  };

  return (
    <>
      <h1>Hellow,{greeting}</h1>
    </>
  );
}

export default App;
